import {
  InferType,
  TypeGuard,
  ObjectOf,
  Transform,
  ObjectWith,
} from './generics'

const defaultValueName = 'value'
const defaultTransformName = 'fn'

const joinArrayWithConjugation = (
  values: Array<string>,
  conjugation: string,
): string => {
  const length = values.length
  if (length > 1) {
    const last = values[length - 1]
    const body = values.slice(0, -1).join(', ')
    return `${body}, ${conjugation} ${last}`
  }
  return values[0] || ''
}

const enum Token {
  OR = 'or',
  AND = 'and',
}

class TypeRules {
  rules: Array<string>
  token: Token
  constructor(rules: Array<string>, token: Token) {
    this.rules = rules
    this.token = token
  }

  toString(): string {
    return joinArrayWithConjugation(this.rules, this.token)
  }
}

export class Type<T> {
  rules: TypeRules
  description: string
  validate: TypeGuard<T>

  constructor(description: string, validate: TypeGuard<T>) {
    this.rules = new TypeRules([description], Token.OR)
    this.description = description
    this.validate = validate
  }

  validateWith(value: any, transform: Transform<any>): value is T {
    return this.validate(transform(value))
  }

  assert(value: any, label: string = defaultValueName): T {
    if (!this.validate(value)) {
      throw `${label} must be ${this.description}`
    }
    return value
  }

  assertWith(
    value: any,
    transform: Transform<any>,
    label: string = defaultValueName,
  ): T {
    const name = transform.name || defaultTransformName
    const transformedValue = transform(value)
    if (!this.validate(transformedValue)) {
      throw `${name}(${label}) must be ${this.description}`
    }
    return transformedValue
  }

  static is<T>(description: string, validate: TypeGuard<T>): Type<T> {
    return new Type(`${description}`, validate)
  }

  // static not<T>(description: string, validate: TypeGuard<T>): DataType<T> {
  //   return new DataType(`not ${description}`, (value: any) => !validate(value))
  // }

  static isShapeOf<S extends { [key: string]: Type<any> }>(
    shape: S,
  ): Type<{ [K in keyof S]: InferType<S[K]> }> {
    const keys: Array<keyof S> = Object.keys(shape)
    const description: string = joinArrayWithConjugation(
      keys.map((key) => `${key} is ${shape[key].description}`),
      Token.AND,
    )
    return Type.is(
      `an object where property ${description}`,
      (value: any): value is { [K in keyof S]: InferType<S[K]> } =>
        value != null && keys.every((key) => shape[key].validate(value[key])),
    )
  }

  static isEqualTo<T extends string | number | boolean | null | undefined>(
    reference: T,
  ): Type<T> {
    return Type.is(
      `equal to ${String(reference)}`,
      (value: any): value is typeof reference => value === reference,
    )
  }

  static isWith<T extends string>(key: T): Type<ObjectWith<T>> {
    return Type.is(
      `an object with property "${key}"`,
      (value: any): value is ObjectWith<T> =>
        value != null && value[key] !== undefined,
    )
  }

  static isAt<T extends PropertyKey>(key: T): Type<ObjectWith<T>> {
    return Type.is(
      `an object with ${typeof key === 'number' ? 'index' : 'key'} ${String(
        key,
      )}`,
      (value: any): value is ObjectWith<T> =>
        value != null && value[key] !== undefined,
    )
  }

  static isObjectOf<T>(
    description: string,
    validate: TypeGuard<T>,
  ): Type<ObjectOf<any, T>> {
    return Type.is(
      description,
      (value: any): value is ObjectOf<any, T> =>
        value != null && Object.values(value).every(validate),
    )
  }

  static isArrayOf<T>(
    description: string,
    validate: TypeGuard<T>,
  ): Type<Array<T>> {
    return Type.is(
      description,
      (value: any): value is Array<T> =>
        Array.isArray(value) && value.every(validate),
    )
  }

  static or<T extends Type<any>>(types: Array<T>) {
    return Type.is(
      joinArrayWithConjugation(types.map((type) => type.description), Token.OR),
      (value: any): value is InferType<T> => {
        return types.some((type) => type.validate(value))
      },
    )
  }

  static and<T extends Type<any>>(types: Array<T>) {
    return Type.is(
      joinArrayWithConjugation(
        types.map((type) => type.description),
        Token.AND,
      ),
      (value: any): value is InferType<T> => {
        return types.some((type) => type.validate(value))
      },
    )
  }
}
